webpackJsonp([0x8a745b29be0a],{3072:function(e,n){e.exports={pathContext:{docHtml:'<h1>randomatic <a href="https://www.npmjs.com/package/randomatic"><img src="https://img.shields.io/npm/v/randomatic.svg?style=flat" alt="NPM version"></a> <a href="https://npmjs.org/package/randomatic"><img src="https://img.shields.io/npm/dm/randomatic.svg?style=flat" alt="NPM monthly downloads"></a> <a href="https://npmjs.org/package/randomatic"><img src="https://img.shields.io/npm/dt/randomatic.svg?style=flat" alt="NPM total downloads"></a> <a href="https://travis-ci.org/jonschlinkert/randomatic"><img src="https://img.shields.io/travis/jonschlinkert/randomatic.svg?style=flat&#x26;label=Travis" alt="Linux Build Status"></a></h1>\n<blockquote>\n<p>Generate randomized strings of a specified length, fast. Only the length is necessary, but you can optionally generate patterns using any combination of numeric, alpha-numeric, alphabetical, special or custom characters.</p>\n</blockquote>\n<h2>Install</h2>\n<p>Install with <a href="https://www.npmjs.com/">npm</a>:</p>\n<pre><code class="language-sh">$ npm install --save randomatic\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">var randomize = require(\'randomatic\');\n</code></pre>\n<h2>API</h2>\n<pre><code class="language-js">randomize(pattern, length, options);\n</code></pre>\n<ul>\n<li><code>pattern</code> <strong>{String}</strong>: The pattern to use for randomizing</li>\n<li><code>length</code> <strong>{Object}</strong>: The length of the string to generate</li>\n</ul>\n<h3>pattern</h3>\n<blockquote>\n<p>The pattern to use for randomizing</p>\n</blockquote>\n<p>Patterns can contain any combination of the below characters, specified in any order.</p>\n<p><strong>Example:</strong></p>\n<p>To generate a 10-character randomized string using all available characters:</p>\n<pre><code class="language-js">randomize(\'*\', 10);\n//=>\n\nrandomize(\'Aa0!\', 10);\n//=>\n</code></pre>\n<ul>\n<li><code>a</code>: Lowercase alpha characters (<code>abcdefghijklmnopqrstuvwxyz\'</code>)</li>\n<li><code>A</code>: Uppercase alpha characters (<code>ABCDEFGHIJKLMNOPQRSTUVWXYZ\'</code>)</li>\n<li><code>0</code>: Numeric characters (<code>0123456789\'</code>)</li>\n<li><code>!</code>: Special characters (<code>~!@#$%^&#x26;()_+-={}[];\\\',.</code>)</li>\n<li><code>*</code>: All characters (all of the above combined)</li>\n<li><code>?</code>: Custom characters (pass a string of custom characters to the options)</li>\n</ul>\n<h3>length</h3>\n<blockquote>\n<p>the length of the string to generate</p>\n</blockquote>\n<p><strong>Examples:</strong></p>\n<ul>\n<li><code>randomize(\'A\', 5)</code> will generate a 5-character, uppercase, alphabetical, randomized string, e.g. <code>KDJWJ</code>.</li>\n<li><code>randomize(\'0\', 2)</code> will generate a 2-digit random number</li>\n<li><code>randomize(\'0\', 3)</code> will generate a 3-digit random number</li>\n<li><code>randomize(\'0\', 12)</code> will generate a 12-digit random number</li>\n<li><code>randomize(\'A0\', 16)</code> will generate a 16-character, alpha-numeric randomized string</li>\n</ul>\n<p>If <code>length</code> is left undefined, the length of the pattern in the first parameter will be used. For example:</p>\n<ul>\n<li><code>randomize(\'00\')</code> will generate a 2-digit random number</li>\n<li><code>randomize(\'000\')</code> will generate a 3-digit random number</li>\n<li><code>randomize(\'0000\')</code> will generate a 4-digit random number...</li>\n<li><code>randomize(\'AAAAA\')</code> will generate a 5-character, uppercase alphabetical random string...</li>\n</ul>\n<p>These are just examples, <a href="./test.js">see the tests</a> for more use cases and examples.</p>\n<h4>chars</h4>\n<p>Type: <code>String</code></p>\n<p>Default: <code>undefined</code></p>\n<p>Define a custom string to be randomized.</p>\n<p><strong>Example:</strong></p>\n<ul>\n<li><code>randomize(\'?\', 20, {chars: \'jonschlinkert\'})</code> will generate a 20-character randomized string from the letters contained in <code>jonschlinkert</code>.</li>\n<li><code>randomize(\'?\', {chars: \'jonschlinkert\'})</code> will generate a 13-character randomized string from the letters contained in <code>jonschlinkert</code>.</li>\n</ul>\n<h2>Usage Examples</h2>\n<ul>\n<li><code>randomize(\'A\', 4)</code> (<em>whitespace insenstive</em>) would result in randomized 4-digit uppercase letters, like, <code>ZAKH</code>, <code>UJSL</code>... etc.</li>\n<li><code>randomize(\'AAAA\')</code> is equivelant to <code>randomize(\'A\', 4)</code></li>\n<li><code>randomize(\'AAA0\')</code> and <code>randomize(\'AA00\')</code> and <code>randomize(\'A0A0\')</code> are equivelant to <code>randomize(\'A0\', 4)</code></li>\n<li><code>randomize(\'aa\')</code>: results in double-digit, randomized, lower-case letters (<code>abcdefghijklmnopqrstuvwxyz</code>)</li>\n<li><code>randomize(\'AAA\')</code>: results in triple-digit, randomized, upper-case letters (<code>ABCDEFGHIJKLMNOPQRSTUVWXYZ</code>)</li>\n<li><code>randomize(\'0\', 6)</code>: results in six-digit, randomized numbers (<code>0123456789</code>)</li>\n<li><code>randomize(\'!\', 5)</code>: results in single-digit randomized, <em>valid</em> non-letter characters (`~!@#$%^&#x26;()_+-={}[]</li>\n<li><code>randomize(\'A!a0\', 9)</code>: results in nine-digit, randomized characters (any of the above)</li>\n</ul>\n<p><em>The order in which the characters are defined is insignificant.</em></p>\n<h2>About</h2>\n<h3>Related projects</h3>\n<ul>\n<li><a href="https://www.npmjs.com/package/pad-left">pad-left</a>: Left pad a string with zeros or a specified string. Fastest implementation. | <a href="https://github.com/jonschlinkert/pad-left" title="Left pad a string with zeros or a specified string. Fastest implementation.">homepage</a></li>\n<li><a href="https://www.npmjs.com/package/pad-right">pad-right</a>: Right pad a string with zeros or a specified string. Fastest implementation. | <a href="https://github.com/jonschlinkert/pad-right" title="Right pad a string with zeros or a specified string. Fastest implementation.">homepage</a></li>\n<li><a href="https://www.npmjs.com/package/repeat-string">repeat-string</a>: Repeat the given string n times. Fastest implementation for repeating a string. | <a href="https://github.com/jonschlinkert/repeat-string" title="Repeat the given string n times. Fastest implementation for repeating a string.">homepage</a></li>\n</ul>\n<h3>Contributing</h3>\n<p>Pull requests and stars are always welcome. For bugs and feature requests, <a href="../../issues/new">please create an issue</a>.</p>\n<h3>Contributors</h3>\n<table>\n<thead>\n<tr>\n<th><strong>Commits</strong></th>\n<th><strong>Contributor</strong></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>41</td>\n<td><a href="https://github.com/jonschlinkert">jonschlinkert</a></td>\n</tr>\n<tr>\n<td>1</td>\n<td><a href="https://github.com/TrySound">TrySound</a></td>\n</tr>\n<tr>\n<td>1</td>\n<td><a href="https://github.com/Drag0s">Drag0s</a></td>\n</tr>\n<tr>\n<td>1</td>\n<td><a href="https://github.com/paulmillr">paulmillr</a></td>\n</tr>\n<tr>\n<td>1</td>\n<td><a href="https://github.com/sunknudsen">sunknudsen</a></td>\n</tr>\n</tbody>\n</table>\n<h3>Building docs</h3>\n<p><em>(This project\'s readme.md is generated by <a href="https://github.com/verbose/verb-generate-readme">verb</a>, please don\'t edit the readme directly. Any changes to the readme must be made in the <a href=".verb.html">.verb.md</a> readme template.)</em></p>\n<p>To generate the readme, run the following command:</p>\n<pre><code class="language-sh">$ npm install -g verbose/verb#dev verb-generate-readme &#x26;&#x26; verb\n</code></pre>\n<h3>Running tests</h3>\n<p>Running and reviewing unit tests is a great way to get familiarized with a library and its API. You can install dependencies and run tests with the following command:</p>\n<pre><code class="language-sh">$ npm install &#x26;&#x26; npm test\n</code></pre>\n<h3>Author</h3>\n<p><strong>Jon Schlinkert</strong></p>\n<ul>\n<li><a href="https://github.com/jonschlinkert">github/jonschlinkert</a></li>\n<li><a href="https://twitter.com/jonschlinkert">twitter/jonschlinkert</a></li>\n</ul>\n<h3>License</h3>\n<p>Copyright Â© 2017, <a href="https://github.com/jonschlinkert">Jon Schlinkert</a>.\nReleased under the <a href="LICENSE">MIT License</a>.</p>\n<hr>\n<p><em>This file was generated by <a href="https://github.com/verbose/verb-generate-readme">verb-generate-readme</a>, v0.6.0, on June 09, 2017.</em></p>',docPath:"argo-ci/node_modules/randomatic/readme",proj:"argo-ci"}}}});
